import React from 'react';
import styles from './MenuList.module.css';

import MenuItem from './MenuItem/MenuItem';

const MenuList = () => {
  return (
    <div className={styles.MenuList}>
      <MenuItem name="Dashboard" to="/" icon="fas fa-tachometer-alt" />
      <MenuItem name="New Jobs" to="/jobs" icon="fas fa-briefcase" />
      {/* <MenuItem name="Doctors" to="/doctors" number="46" /> */}
      {/* <MenuItem name="Nurses" to="/nurses" number="99+" /> */}
    </div>
  );
};

export default MenuList;
